- input: "TEXT\x1CC00148098\x1C.TEXT\x1C\x1CF3XA\x1CThis amendment is in response
    to an FEC letter dated 4/3/14 referencing the Mid-Year Report (07/01/13 - 12/31/13).
    \ In that report, payments made to our 2 parent unions were incorrectly listed
    as Transfers to their COPE accounts.  After discussions with AFT and SEIU, the
    COPE funds transmitted from PEF are not used for political contributions but for
    administrative and educational costs.  After discussions with staff at the FEC
    it was determined that these transfers to our parent unions should be listed under
    29 Other Disbursements rather than transfers.\n"
